      {/* Banner */}
      <Banner/>

      {/* Row */}
      {/* Each row will take a few different props */}
      {/* Props allow us to customise one component from another */}
      <Row
        title="NETFLIX ORIGINALS"
        fetchUrl={requests.fetchNetflixOriginals}
        isLargeRow
      />
      <Row
        title="Trending Now"
        fetchUrl={requests.fetchTrending}
        isLargeRow
      />
      <Row
      />
